import React from 'react';
import './linkbutton.css'
import { Link } from "react-router-dom";



const LinkButton = ({path, content, primary}) => {
  const background = primary ? '#FF7597' : '#424242';
  const main = primary ? 'black' : 'white'
  return (
    <div className="link-wrapper" style={{ backgroundColor: background,}} >
      <Link style={{color: main}} className="link"  to={path}>{content}</Link>
    </div>
  )
}

export default LinkButton;
